import { Link, useNavigate } from "react-router-dom";
import {useState, useEffect} from "react";
import Header from '../components/Header.js';
import styles from '../styles.js';

function Problem( { user } ) {

    const containerStyle = {
        display: 'flex',
        flexDirection: 'row'
    }

    const itemStyle = {
        flex: 1,
        textAlign: 'center',
        fontSize: '32px',
        borderStyle: 'solid',
        borderColor: 'grey',
        margin: 15
    }

    return (
        <div>
            <Header text={'User'}/>
            <div style={containerStyle}>
                <div style={itemStyle}>
                    <h1>Problems</h1>
                </div>

                <div style={itemStyle}>
                    <h1>Problem information</h1>
                    <div>
                        <h2>Problem's Submissions</h2>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Problem;
